BEGIN	

	DBMS_OUTPUT.PUT_LINE('[INICIO] ');
  
  EXECUTE IMMEDIATE('ANALYZE TABLE '||V_ESQUEMA||'.ACT_ACTIVO COMPUTE STATISTICS');
  
  DBMS_OUTPUT.PUT_LINE('[INFO] '||V_ESQUEMA||'.ACT_ACTIVO ANALIZADA.');
  
  EXECUTE IMMEDIATE('ANALYZE TABLE '||V_ESQUEMA||'.BIE_ADJ_ADJUDICACION COMPUTE STATISTICS');
  
  DBMS_OUTPUT.PUT_LINE('[INFO] '||V_ESQUEMA||'.BIE_ADJ_ADJUDICACION ANALIZADA.');

	DBMS_OUTPUT.PUT_LINE('[INFO] INICIO DEL PROCESO, DE ACTUALIZACION FECHAS EN BIE_ADJ_ADJUDICACION.');
	
	DBMS_OUTPUT.PUT_LINE('[INFO] COMPROBAMOS LA EXISTENCIA DE LOS ACTIVOS.');
  
  V_COUNT := 0;
  V_ROWS := 0;
  V_ROWS1 := 0;
  V_ROWS2 := 0;
  V_ROWS3 := 0;


	FOR I IN V_TIPO_DATA.FIRST .. V_TIPO_DATA.LAST
	LOOP
    
       V_TMP_TIPO_DATA := V_TIPO_DATA(I);
           
       V_SQL := 'SELECT COUNT(1) FROM '||V_ESQUEMA||'.ACT_ACTIVO WHERE ACT_NUM_ACTIVO_UVEM = '||V_TMP_TIPO_DATA(1)||'';
       
       EXECUTE IMMEDIATE V_SQL INTO V_NUM;

       IF V_NUM < 1 THEN	
       
          DBMS_OUTPUT.PUT_LINE('[INFO] '||V_TMP_TIPO_DATA(1)||' INEXISTENTE.');
      
          V_COUNT := V_COUNT + 1;
          
        ELSE 
        
          --BIE_ADJ_F_DECRETO_N_FIRME
          if V_TMP_TIPO_DATA(2) != 0 then
                  
            V_MSQL := '
            MERGE INTO '||V_ESQUEMA||'.BIE_ADJ_ADJUDICACION ADJ USING
            (
            SELECT DISTINCT
            ACT.ACT_NUM_ACTIVO_UVEM,
            ACT.ACT_ID,
            ACT.BIE_ID,
            ADJ.BIE_ADJ_ID,
            ADJ.BIE_ADJ_F_DECRETO_N_FIRME
            FROM '||V_ESQUEMA||'.ACT_ACTIVO ACT
            INNER JOIN '||V_ESQUEMA||'.BIE_ADJ_ADJUDICACION ADJ
              ON ADJ.BIE_ID = ACT.BIE_ID
            WHERE ACT.ACT_NUM_ACTIVO_UVEM = '||V_TMP_TIPO_DATA(1)||'
            ) TMP
            ON (ADJ.BIE_ADJ_ID = TMP.BIE_ADJ_ID)
            WHEN MATCHED THEN UPDATE SET
            ADJ.BIE_ADJ_F_DECRETO_N_FIRME = to_date('''||V_TMP_TIPO_DATA(2)||''',''yyyyMMdd''),
            ADJ.USUARIOMODIFICAR = ''HREOS-616'',
            ADJ.FECHAMODIFICAR = SYSDATE
            WHERE ADJ.BIE_ADJ_F_DECRETO_N_FIRME not like to_date('''||V_TMP_TIPO_DATA(2)||''',''yyyyMMdd'')
            OR ADJ.BIE_ADJ_F_DECRETO_N_FIRME IS NULL
            '
            ;
            
            EXECUTE IMMEDIATE V_MSQL;
            
            V_ROWS := V_ROWS + SQL%ROWCOUNT;
            
          end if;
          
          --BIE_ADJ_F_DECRETO_FIRME 
          if V_TMP_TIPO_DATA(3) != 0 then
                  
            V_MSQL := '
            MERGE INTO '||V_ESQUEMA||'.BIE_ADJ_ADJUDICACION ADJ USING
            (
            SELECT DISTINCT
            ACT.ACT_NUM_ACTIVO_UVEM,
            ACT.ACT_ID,
            ACT.BIE_ID,
            ADJ.BIE_ADJ_ID,
            ADJ.BIE_ADJ_F_DECRETO_FIRME 
            FROM '||V_ESQUEMA||'.ACT_ACTIVO ACT
            INNER JOIN '||V_ESQUEMA||'.BIE_ADJ_ADJUDICACION ADJ
              ON ADJ.BIE_ID = ACT.BIE_ID
            WHERE ACT.ACT_NUM_ACTIVO_UVEM = '||V_TMP_TIPO_DATA(1)||'
            ) TMP
            ON (ADJ.BIE_ADJ_ID = TMP.BIE_ADJ_ID)
            WHEN MATCHED THEN UPDATE SET
            ADJ.BIE_ADJ_F_DECRETO_FIRME  = to_date('''||V_TMP_TIPO_DATA(3)||''',''yyyyMMdd''),
            ADJ.USUARIOMODIFICAR = ''HREOS-616'',
            ADJ.FECHAMODIFICAR = SYSDATE
            WHERE ADJ.BIE_ADJ_F_DECRETO_FIRME not like to_date('''||V_TMP_TIPO_DATA(3)||''',''yyyyMMdd'')
            OR ADJ.BIE_ADJ_F_DECRETO_FIRME IS NULL
            '
            ;
            
            EXECUTE IMMEDIATE V_MSQL;
            
            V_ROWS1 := V_ROWS1 + SQL%ROWCOUNT;
            
          end if;
          
          --BIE_ADJ_F_INSCRIP_TITULO 
          if V_TMP_TIPO_DATA(4) != 0 then
                  
            V_MSQL := '
            MERGE INTO '||V_ESQUEMA||'.BIE_ADJ_ADJUDICACION ADJ USING
            (
            SELECT DISTINCT
            ACT.ACT_NUM_ACTIVO_UVEM,
            ACT.ACT_ID,
            ACT.BIE_ID,
            ADJ.BIE_ADJ_ID,
            ADJ.BIE_ADJ_F_INSCRIP_TITULO 
            FROM '||V_ESQUEMA||'.ACT_ACTIVO ACT
            INNER JOIN '||V_ESQUEMA||'.BIE_ADJ_ADJUDICACION ADJ
              ON ADJ.BIE_ID = ACT.BIE_ID
            WHERE ACT.ACT_NUM_ACTIVO_UVEM = '||V_TMP_TIPO_DATA(1)||'
            ) TMP
            ON (ADJ.BIE_ADJ_ID = TMP.BIE_ADJ_ID)
            WHEN MATCHED THEN UPDATE SET
            ADJ.BIE_ADJ_F_INSCRIP_TITULO  = to_date('''||V_TMP_TIPO_DATA(4)||''',''yyyyMMdd''),
            ADJ.USUARIOMODIFICAR = ''HREOS-616'',
            ADJ.FECHAMODIFICAR = SYSDATE
            WHERE ADJ.BIE_ADJ_F_INSCRIP_TITULO not like to_date('''||V_TMP_TIPO_DATA(4)||''',''yyyyMMdd'')
            OR ADJ.BIE_ADJ_F_INSCRIP_TITULO IS NULL
            '
            ;
            
            EXECUTE IMMEDIATE V_MSQL;
            
            V_ROWS2 := V_ROWS2 + SQL%ROWCOUNT;
            
          end if;
          
          --BIE_ADJ_F_REA_POSESION 
          if V_TMP_TIPO_DATA(5) != 0 then
                  
            V_MSQL := '
            MERGE INTO '||V_ESQUEMA||'.BIE_ADJ_ADJUDICACION ADJ USING
            (
            SELECT DISTINCT
            ACT.ACT_NUM_ACTIVO_UVEM,
            ACT.ACT_ID,
            ACT.BIE_ID,
            ADJ.BIE_ADJ_ID,
            ADJ.BIE_ADJ_F_REA_POSESION 
            FROM '||V_ESQUEMA||'.ACT_ACTIVO ACT
            INNER JOIN '||V_ESQUEMA||'.BIE_ADJ_ADJUDICACION ADJ
              ON ADJ.BIE_ID = ACT.BIE_ID
            WHERE ACT.ACT_NUM_ACTIVO_UVEM = '||V_TMP_TIPO_DATA(1)||'
            ) TMP
            ON (ADJ.BIE_ADJ_ID = TMP.BIE_ADJ_ID)
            WHEN MATCHED THEN UPDATE SET
            ADJ.BIE_ADJ_F_REA_POSESION  = to_date('''||V_TMP_TIPO_DATA(5)||''',''yyyyMMdd''),
            ADJ.USUARIOMODIFICAR = ''HREOS-616'',
            ADJ.FECHAMODIFICAR = SYSDATE
            WHERE ADJ.BIE_ADJ_F_REA_POSESION not like to_date('''||V_TMP_TIPO_DATA(5)||''',''yyyyMMdd'')
            OR ADJ.BIE_ADJ_F_REA_POSESION IS NULL
            '
            ;
            
            EXECUTE IMMEDIATE V_MSQL;
            
            V_ROWS3 := V_ROWS3 + SQL%ROWCOUNT;
            
          end if;
      
       END IF;
          
    END LOOP;
        
    DBMS_OUTPUT.PUT_LINE('[INFO] '||V_COUNT||' ACTIVOS INEXISTENTES.');
    
    DBMS_OUTPUT.PUT_LINE('[INFO] '||V_ROWS||' REGISTROS ACTUALIZADOS EN BIE_ADJ_F_DECRETO_N_FIRME.');
